import React from 'react';

const Invoices: React.FC = () => {
  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Invoices</h1>
        <p className="text-gray-600">Create and manage customer invoices with GST compliance.</p>
      </div>

      <div className="card p-8 text-center">
        <h3 className="text-lg font-medium text-gray-900 mb-2">Invoice Management</h3>
        <p className="text-gray-600">This module will include invoice creation, GST calculation, payment tracking, and reporting.</p>
      </div>
    </div>
  );
};

export default Invoices;
